script: |
  super -f text -I q9792.spq | sort > q9792.out

inputs:
  - name: q9792.spq
    data: |
      SELECT DISTINCT + - COUNT ( * ) col0 FROM tab1 (FORMAT parquet) WHERE ( NULL ) <= col2 + + ( - - col1 ) + + col2 * + col1 OR NOT + - 92 * 43 * + + 78 IS NULL;
  - name: tab1

outputs:
  - name: q9792.out
    data: |
      -3
